import React from "react";
import Navbar from "./Navbar.js";

function App() {

  fetch('https://reqres.in/api/users?page=1')
    .then((response) => response.json())
    .then((data) => {
      console.log(data)
    });

  return (
    <div className="App">
      <Navbar />
      <div className="users">
        <div>
          <img src="https://reqres.in/img/faces/2-image.jpg" />
        </div>
        <div className="details">
          <p className="id"><span>ID: </span>2</p>
          <div className="name">
            <p className="f_name"><span>First Name: </span>Janet</p>
            <p className="l_name"><span>Last Name: </span>Weaver</p>
          </div>
          <p className="email"><span>E-mail: </span>janet.weaver@reqres.in</p>
        </div>
      </div>
    </div>
  );
}

export default App;
